import { Component, EventEmitter, Input, Output, ViewEncapsulation } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
  encapsulation: ViewEncapsulation.None

})
export class AppComponent {
  title = 'rds-alert';

  // visibility true or false
  @Input() visibility = false;

  @Input()
  alertOpen = true

  // @Input()
  // showicon =false
  // @Input()
  // showheading =true
  @Input()
  dismisable = true
  // background-color property
  @Input() backgroundColor?: string;

  @Input() color?: string;

  // added icon in Alert Box

  @Input() icon = 'bi bi-info-circle';

  @Input() label = 'A simple primary alert—check it out!';
  @Input() heading = 'Heading';
  @Input() type: 'primary' | 'secondary' | 'success' | 'danger' | 'warning' | 'info' | 'light' | 'dark' = 'primary';

  // tslint:disable-next-line:no-output-on-prefix
  @Output() onDismiss = new EventEmitter<Event>();
  // tslint:disable-next-line:no-output-on-prefix
  @Output() onShow = new EventEmitter<Event>(this.visibility = true);

  public get classes(): string {
    const mode = `alert alert-${this.type} alert-dismissible fade show`;

    return mode;
  }
  // public get showIcon():string{
  //   let icon = ''
  //   if(this.showicon=== true){
  //     icon = 'd-none'
  //   }
  //   return icon

  // }

  public get withDismiss(): string {
    let dismiss = 'd-none'
    if (this.dismisable === true) {
      dismiss = ''
    }
    return dismiss

  }

  showAlert() {
    this.alertOpen = true
  }

  closeAlert() {
    this.alertOpen = false;
    this.onDismiss.emit();
    console.log(this.alertOpen)
  }

  // tslint:disable-next-line:typedef
  close() {
    this.visibility = true;
  }
}

import { Component, EventEmitter, Input, Output } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent {

  // Add the inputs and outputs for the component here
  @Input() label: string;
  @Input() type: 'primary' | 'secondary' | 'light' = 'primary';
  @Input() size: 'sm' | 'md' | 'lg' = 'sm';
  @Output() click = new EventEmitter<void>();

  // Configure the button styles based on the inputs
  // This logic will vary according to the component
  get classes() {
    return [`btn-${this.type}`, `btn-${this.size}`].join(' ');
  }
}

import { Component, EventEmitter, Input, OnInit, Output, ViewEncapsulation } from '@angular/core';
@Component({
  selector: 'rds-datepicker',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
  encapsulation: ViewEncapsulation.None,
})
export class AppComponent implements OnInit {
  //title = 'rds-datepicker';
  selectedDate = new Date();
  bsInlineValue = new Date();
  bsInlineRangeValue?: Date[];
  currentDate = new Date();
  yesterdayDate = new Date();
  lastSevendate = new Date();
  lastFourteendate = new Date();
  firstRange: any;
  lastRange: any;
  maxDate = new Date();
  title = 'Today';
  dateRange?: Date[];
  public dates = new Date();
  newDate?: 'currentDate' | 'yesterdayDate' | 'lastSevendate' | 'lastFourteendate' | 'custom' = 'currentDate';
  @Input() Label = "Date range";
  @Output() change = new EventEmitter<Date>();
  constructor() {
    this.maxDate.setDate(this.maxDate.getDate() + 7);
    this.bsInlineRangeValue = [this.bsInlineValue];
  }
  ngOnInit(): void {
    // throw new Error('Method not implemented.');
  }

  todayDate(event: Event): void {
    this.currentDate = this.dates;
    this.newDate = 'currentDate';
    this.title = 'Today';
  }
  yesDate(event: Event): void {
    this.yesterdayDate.setDate(this.dates.getDate() - 1);
    this.newDate = 'yesterdayDate';
    this.title = 'Yesterday';
  }
  lastSevenDate(event: Event): void {
    this.lastSevendate.setDate(this.dates.getDate() - 7);
    this.newDate = 'lastSevendate';
    this.title = ' Last 7 days';
  }
  lastFourteenDate(event: Event): void {
    this.lastFourteendate.setDate(this.dates.getDate() - 14);
    this.title = 'Last 14 days';
    this.newDate = 'lastFourteendate';
  }

  changeDate(value: any) {
    let rangeDate = value;
    this.firstRange = rangeDate[0];
    this.lastRange = rangeDate[1];
    this.newDate = 'custom';
    this.title = 'Custom Date';
  }
}

