  /* calender css */
  .calendar {
    --side-padding: 20px;
    --border-radius: 34px;
    --accent-br: 15px;
    width: 300px;
    background: #FFFFFF 0% 0% no-repeat padding-box;
    margin-left: 55px;
    margin-top: 15px;
    border-radius: 4px;
  }
  
  .calendar select {
    background-color: #f3f4f6;
    padding: 15px 20px;
  }
  
  .calendar__opts, .calendar__buttons {
    background-color: #fff;
    display: grid;
    grid-template-columns: 1fr 1fr;
    column-gap: 15px;
  }
  
  .calendar__opts {
    border-top-left-radius: var(--border-radius);
    border-top-right-radius: var(--border-radius);
    padding: 20px var(--side-padding);
  }
  
  .calendar__body {
    background-image: linear-gradient(to bottom, #f3f4f6, #fff);
  }
  
  .calendar__days {
    background-color: #fff;
    padding-bottom: 10px;
    display: grid;
    grid-template-columns: repeat(7, 1fr);
  }
  
  .calendar__days > div {
    text-align: center;
    font-weight: 700;
    font-size: 1.02rem;
    color: #c5c8ca;
  }
  
  .calendar__dates {
    display: grid;
    grid-template-columns: repeat(7, 1fr);
    background-color: #fff;
  }
  
  .calendar__date {
    --height: calc(400px / 6 - var(--side-padding));
    text-align: center;
    height: var(--height);
    line-height: var(--height);
    font-weight: 600;
    font-size: 1.02rem;
    cursor: pointer;
    position: relative;
  }
  
  .calendar__date::before {
    content: "";
    position: absolute;
    background-color: rgba(255, 255, 255, 0);
    width: 100%;
    height: calc(var(--height) * 0.6);
    top: 49%;
    left: 49%;
    transform: translate(-50%, -50%);
    border-radius: var(--accent-br);
    transition: background-color 0.3s ease;
  }
  
  .calendar__date:not(.calendar__date--selected):not(.calendar__date--grey):hover::before {
    background-color: #ededed;
  }
  
  .calendar__date--grey {
    color: #c5c8ca;
    cursor: not-allowed;
  }
  
  .calendar__date--selected {
    color: #fff;
  }
  
  .calendar__date--selected::before {
    background-color: #b1c3f2;
    border-radius: 0px;
  }
  
  .calendar__date--range-start::after {
    content: "";
    position: absolute;
    bottom: 3px;
    border-radius: 24px;
    left: 50%;
    transform: translateX(-50%);
    background-color: transparent;
    width: 10px;
    height: 4px;
  }
  
  .calendar__date--range-end {
    color: #fff;
  }
  
  .calendar__date--range-end::before {
